func BenchmarkDumpTo(b *testing.B) {
	bytes, err := hex.DecodeString(strings.Replace(generatorHex, "\n", "", -1))
	if err != nil {
		b.Fatal(err)
	}
	var prog types.SerializedProgram
	if err := utils.FromByteSliceExact(bytes, &prog); err != nil {
		b.Fatal(err)
	}
	var outBuf []byte
	b.ResetTimer()
	for i := 0; i < b.N; i++ {
		outBuf = outBuf[:0]
		prog.Root.DumpTo(&outBuf)
	}
}

func BenchmarkAdd(b *testing.B) {
	prog, err := clvm.SExpFromIRString("(+ 1 2 3 4 5 6 7 8 9 0)")
	if err != nil {
		b.Fatal(err)
	}
	b.ResetTimer()
	for i := 0; i < b.N; i++ {
		clvm.RunProgram(prog, clvm.NULL)
	}
}
